import React from 'react'

const AboutContent = () => {
  return (
    <section className="container about">
      <h3>Our Mission & Vision</h3>
      <p className="about-text1">Estendo Power Products Company Ltd. is a private company registered in 1996 and it is located at 292 Wharf Road, Apapa, Lagos.</p>
      <p className="about-text2">Estendo Power Products continues to be a market leader in its industry by offering best selling and authentic products that have been enjoyed by customers for over a decade. Estendo Power Products is managed by a team of professionals with several years of experience in retail and wholesale distribution of power equipment and other electrical and electronic items. In over two decades of corporate existence, the firm has gained a very strong reputation both at home and aboard and we have established links with companies within and outside Nigeria.</p>
      <p className="about-text3">Thus, the company has business partners in Japan, China, Taiwan and the United Arab Emirates who are leading producers of global power brand brands such as Elepon, Honda, Fuji, Elemax, Sumec, Tigmax, Tiger, Parsun, kipor and PM&T pumps. Our products are widely distributed across Nigeria through our strategic sales network, strong partnerships with electronic department stores and provision of excellent after sales service.</p>
    </section>
  )
}

export default AboutContent
